import React from "react";
import "./styles.css";
import logo from "./img/tiendaLogo.png";
import logoCart from "./img/cartLogo.svg";
import logoMenu from "./img/menu.svg";

const Header = ({ cartProducts }) => {
    return (
        <header>
            <img src={logo} alt="Logo" className="logo" />
            <h1>Mi Tiendita de la Esquina</h1>
            <div>
                <span>{cartProducts.length}</span>
                <img src={logoCart} alt="logoCart" className="logo__cart" />
            </div>
            <img src={logoMenu} alt="logoMenu" className="logo__menu" />  
        </header>
    );
};

export default Header;
